			shellScript = "# Firebase Crashlytics dSYM Upload Script\n# Skip for simulator builds\nif [ \"${EFFECTIVE_PLATFORM_NAME}\" == \"-iphonesimulator\" ]; then\n    echo \"Skipping Crashlytics dSYM upload for Simulator build\"\n    exit 0\nfi\n\n# Use the plist from the built app bundle (already copied by Xcode)\nPLIST_IN_BUNDLE=\"${TARGET_BUILD_DIR}/${UNLOCALIZED_RESOURCES_FOLDER_PATH}/GoogleService-Info.plist\"\n\n# Verify the plist exists in the bundle\nif [ ! -f \"${PLIST_IN_BUNDLE}\" ]; then\n    echo \"error: GoogleService-Info.plist not found in app bundle at ${PLIST_IN_BUNDLE}\"\n    exit 1\nfi\n\necho \"Using GoogleService-Info.plist from: ${PLIST_IN_BUNDLE}\"\n\n# Find the Crashlytics upload script\nCRASHLYTICS_SCRIPT=\"${BUILD_DIR%/Build/*}/SourcePackages/checkouts/firebase-ios-sdk/Crashlytics/run\"\n\nif [ ! -f \"${CRASHLYTICS_SCRIPT}\" ]; then\n    echo \"warning: Crashlytics run script not found at ${CRASHLYTICS_SCRIPT}\"\n    echo \"Attempting alternative path...\"\n    # Try DerivedData path for Archive builds\n    CRASHLYTICS_SCRIPT=$(find \"${HOME}/Library/Developer/Xcode/DerivedData\" -name \"run\" -path \"*/firebase-ios-sdk/Crashlytics/*\" 2>/dev/null | head -1)\nfi\n\nif [ -f \"${CRASHLYTICS_SCRIPT}\" ]; then\n    echo \"Running Crashlytics script from: ${CRASHLYTICS_SCRIPT}\"\n    \"${CRASHLYTICS_SCRIPT}\" -gsp \"${PLIST_IN_BUNDLE}\"\nelse\n    echo \"warning: Crashlytics run script not found. dSYM upload skipped.\"\n    exit 0\nfi\n";
